&lt;p&gt;&lt;span style=&quot;line-height: 1.5;&quot;&gt;&lt;b&gt;&lt;br /&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;b&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(124, 67, 177);&quot;&gt;1. &lt;/span&gt;&amp;nbsp; Fanpage Karma &lt;span style=&quot;color: rgb(93, 93, 93);&quot;&gt;| 1-대-1 비교&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 8pt; color: rgb(93, 93, 93);&quot;&gt;&lt;b&gt;http://www.fanpagekarma.com&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Fanpage Karma는 여러분과 경쟁사의 페이스북, 트위터, 구글플러스, 인스타그램, 유튜브, 그리고 핀터레스트 계정들을 분석해줍니다. 이 중 페이스북이 가장 정확하고 많은 옵션들을 지원하죠. Fanpage Karma의 무료 서비스는 90일짜리 보고서와 무제한의 경쟁사 비교 그리고 매주 리포트를 이메일로 보내줍니다.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile9.uf.tistory.com/image/2604BF4C5693C68E2F790A&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;201&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;이 무료 1-대-1 비교 서비스는 성장률, 가장 많이 사용된 콘텐츠 소스와 키워드, 가장 인기 있는 포스트, 글 올라오는 빈도, 반응이 좋은 날과 시간대, 콘텐츠 종류, 팬층 등 수많은 메트릭을 선보이죠.&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile2.uf.tistory.com/image/276FE14C5693C690134C88&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;486&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;심지어 아래와 같이, 경쟁업체의 키워드는 물론 글의 길이와 성공적인 반응을 이끌어낸 글 종류, SNS 영향력 있는 유저들 등을 보여줘서 여러분과 경쟁업체를 비교해 쉽게 서로의 장단점들을 파악 할 수 있죠.&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile6.uf.tistory.com/image/2475814C5693C69225957E&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;350&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;a href=&quot;http://smartincome.tistory.com/88&quot; target=&quot;_blank&quot; class=&quot;tx-link&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile28.uf.tistory.com/image/264745385693D1E11ECE5B&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;52&quot; style=&quot;&quot;&quot;&quot;/&gt;&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;b&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(124, 67, 177);&quot;&gt;2.&amp;nbsp;&lt;/span&gt;&amp;nbsp; LikeAlyzer&amp;nbsp;&lt;span style=&quot;color: rgb(93, 93, 93);&quot;&gt;| 페이스북 페이지 성과&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#5d5d5d&quot;&gt;&lt;span style=&quot;font-size: 10.6667px; line-height: 10.6667px;&quot;&gt;&lt;b&gt;http://likealyzer.com&lt;/b&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;LikeAlyzer는 아무 페이스북 페이지를 입력하면 빠르게 아래 스크린샷과 같이 &quot;건강 체크&quot;를 합니다. 이 소셜분석 툴은 페이스북 인사이트에 따로 접속할 필요가 없기 때문에&amp;nbsp;경쟁사 분석에 꽤 자주 사용되고 있죠. 다만 위 Fanpage Karma와 같이 1-대-1 비교는 하지 않아서, 여러 창을 따로 띄어놓거나 스크린샷을 찍어 따로 비교해야겠죠. LikeAlyzer는 각 페이스북 페이지마다 자체 평점을 1에서 100까지 매기는데, 비슷한 비즈니스 분야나 카카테고리에 대한 평균 점수도 공개합니다. 추가로 성장률, engagement rate, PTAT (People Talking About This) 등&amp;nbsp;다른 툴들에서 잘 못찾는 스탯을 보여줍니다. LikeAlyzer는 최대한 많은 경쟁사들의 SNS를 찾아 확인해서 여러분 페이지&amp;nbsp;개선점을 찾아나가는 것이 가장 좋은 방법입니다.&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile28.uf.tistory.com/image/2128AE4C5693C69502A26D&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;773&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;a href=&quot;http://smartincome.tistory.com/223&quot; target=&quot;_blank&quot; class=&quot;tx-link&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile1.uf.tistory.com/image/2706E3385693D1FC10B396&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;52&quot; style=&quot;&quot;&quot;&quot;/&gt;&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;b&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(124, 67, 177);&quot;&gt;3.&amp;nbsp;&lt;/span&gt;&amp;nbsp; Klear&amp;nbsp;&lt;span style=&quot;color: rgb(93, 93, 93);&quot;&gt;| 파워유저들을 찾아라&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#5d5d5d&quot;&gt;&lt;span style=&quot;font-size: 10.6667px; line-height: 10.6667px;&quot;&gt;&lt;b&gt;http://klear.com&lt;/b&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;원래 Twtrland라는 이름을 가졌던 Klear는 애널리틱스 대시보드와 SNS 인풀루엔서 (influencer)들을&amp;nbsp;찾는 기능을 선보입니다. Klear을 통해서 SNS에 영향력을 과시하는 유저들 (연예인, 파워유저 등)을 특정 스킬이나 지역에 따라 검색하면 바로 아래와 같이 결과를 보여줍니다. 무료로 충분히 이 검색기능을 이용할 수 있는데, 프로 계정은 훨씬 많은 검색 결과를 볼 수 있죠. 하지만 월 249달러의 프로 계정은 회사가 아닌 이상 조금 부담스러운 가격이네요.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile10.uf.tistory.com/image/276FEB4C5693C69807C89E&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;377&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;Klear를 통해서 파워유저들을 찾아내면, 그들이 활동하는 메인 SNS 플랫폼은 물론 사람들의 반응을 살펴볼 수 있죠. 결정적으로 이 파워유저들이 소셜미디어에서&amp;nbsp;얼마나 영향력을 과시하는지 보여줍니다. 하지만 항상 유의해야 할 것이, 도달율이나 팔로워 숫자 또는 좋아요 숫자가 전부가 아니고 콘텐츠의 퀄러티와 전환율이 우선이 되어야 한다는 점이죠.&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile24.uf.tistory.com/image/2410864C5693C69A230FF4&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;384&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;a href=&quot;http://smartincome.tistory.com/224&quot; target=&quot;_blank&quot; class=&quot;tx-link&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile10.uf.tistory.com/image/2450BE365693D21A2634E5&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;52&quot; style=&quot;&quot;&quot;&quot;/&gt;&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;span style=&quot;font-size: 10pt;&quot;&gt;&lt;b&gt;&lt;span style=&quot;color: rgb(255, 255, 255); background-color: rgb(124, 67, 177);&quot;&gt;4.&amp;nbsp;&lt;/span&gt;&amp;nbsp; Twitonomy&amp;nbsp;&lt;span style=&quot;color: rgb(93, 93, 93);&quot;&gt;| 트위터 소셜분석&lt;/span&gt;&lt;/b&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;&lt;font color=&quot;#5d5d5d&quot;&gt;&lt;span style=&quot;font-size: 10.6667px; line-height: 10.6667px;&quot;&gt;&lt;b&gt;http://twitonomy.com&lt;/b&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p&gt;Twitonomy는 여러분의 트위터 계정으로 회원가입이 가능한데 로그인을 하게 되면 아래 이미지와 같이 오른쪽 사이드에 실시간 분석툴이 나옵니다. 그렇다고 꼭 여러분의 트위터 계정만 보여주는 것이 아니고, 원하는 경쟁사 분석도 해주죠. 이 툴은 하루 평균 트윗 수, 총 리트윗 수, 즐겨찾기 등을 보여주고 링크가 달린 트윗, 해시태그가 달린 트윗, 리트윗과 답글이 달린 트윗 등도 알려줍니다.&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile9.uf.tistory.com/image/223BDB485693C69C19D984&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;431&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;여기서는 여러분의 트위터 계정 (또는 지정한 경쟁사 계정)과 가장 활발한 활동을 벌여온 파워유저들을 보여줍니다.&amp;nbsp;&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile4.uf.tistory.com/image/220944485693C69E08780B&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;384&quot; /&gt;&lt;/span&gt;&lt;/p&gt;&lt;p&gt;개인적으로 Twitonomy의 제일&amp;nbsp;큰 장점은 경쟁사 분석에서 가장 많이 그리고 자주 사용된 해시태그들을 무료로 뽑아주는 기능입니다.&amp;nbsp;&lt;br /&gt;&lt;/p&gt;&lt;p&gt;&lt;br /&gt;&lt;/p&gt;&lt;p style=&quot;text-align: center; clear: none; float: none;&quot;&gt;&lt;a href=&quot;http://smartincome.tistory.com/357&quot; target=&quot;_blank&quot; class=&quot;tx-link&quot;&gt;&lt;span class=&quot;imageblock&quot; style=&quot;display:inline-block;width:600px;;height:auto;max-width:100%&quot;&gt;&lt;img src=&quot;http://cfile21.uf.tistory.com/image/27143B345693D22E1471A0&quot; style=&quot;max-width:100%;height:auto&quot; width=&quot;600&quot; height=&quot;52&quot; style=&quot;&quot;&quot;&quot;/&gt;&lt;/span&gt;&lt;/a&gt;&lt;/p&gt;&lt;div class=&quot;daum_like_wrapper&quot;&gt;&lt;iframe class=&quot;daum_like_button&quot; id=&quot;daum_like_button_361&quot; frameborder=&quot;0&quot; scrolling=&quot;no&quot; allowTransparency=&quot;true&quot; src=&quot;http://smartincome.tistory.com/like/?uid=1907301_361&amp;sc=401%2CblogId_1907301&amp;url=http%3A%2F%2Fsmartincome.tistory.com%2F361&amp;published=1